  input: 'TEXT,F3XA,,"Dear Ms. Manning: I am writing in response to your correspondence
    of January 18, 2002 regarding overlapping coverage dates on recently filed reports.  As
    we discussed on the phone, we realized at the time of the mid-year filing that
    a first quarter report had been filed which was not required.  Upon calling the
    Commission, we were instructed  to file the mid-year report for the entire six-month
    period.  It was explained that since the first quarter report was not required,
    it would have been disregarded.  Accordingly, please eliminate the overlapping
    coverage dates by eliminating the first quarter 2001 filing from your records.  All
    information that is required for the entire six-month period is contained in the
    mid-year filing. Thank you for your help in this matter."'
